//www.bilibili.com/video/BV1jvNnzmEin" target="_blank" rel="noreferrer">Folo: 你的一站式信息订阅平台（可同时订阅B站、油管、X等多个平台的博主）</a></li></ul><h2 id="reference" tabindex="-1">reference <a class="header-anchor" href="#reference" aria-label="Permalink to “reference”">​</a></h2><ul><li><a href="https://www.zhihu.com/question/589301822" target="_blank" rel="noreferrer">如何评价Orbstack（在Mac上低开销地运行容器和Linux）？</a></li></ul><h3 id="登录虚拟机" tabindex="-1">登录虚拟机 <a class="header-anchor" href="#登录虚拟机" aria-label="Permalink to “登录虚拟机”">​</a></h3><ul><li><code>orb -m ubuntu -u xiangliu</code></li></ul><h2 id="disk" tabindex="-1">disk <a class="header-anchor" href="#disk" aria-label="Permalink to “disk”">​</a></h2><ul><li><a href="https://www.mac618.com/795.html#J_DLIPPCont" target="_blank" rel="noreferrer">DaisyDisk</a><ul><li><a href="https://daisydiskapp.com/manual?source=HiddenSpace&amp;appVersion=4.26.1&amp;lang=en&amp;subtopic=StillHiddenSpace&amp;osVersion=14.6.0&amp;topic=HiddenSpace&amp;appEdition=Standard" target="_blank" rel="noreferrer">Hidden space 隐藏空间</a></li></ul></li><li>如何用命令弹出硬盘 <ul><li>查询硬盘挂载路径 <code>df -h</code></li><li>取消挂载 <code>diskutil unmount xxxxx</code></li></ul></li><li>transmit 文件传输工具</li></ul><h2 id="raycast" tabindex="-1">Raycast <a class="header-anchor" href="#raycast" aria-label="Permalink to “Raycast”">​</a></h2><ul><li><a href="https://www.bilibili.com/video/BV1Uo4y137XH" target="_blank" rel="noreferrer">最强macOS生产力软件：Raycast</a></li></ul><h2 id="aerospace" tabindex="-1">AeroSpace <a class="header-anchor" href="#aerospace" aria-label="Permalink to “AeroSpace”">​</a></h2><ul><li><a href="https://www.bilibili.com/video/BV1kBqFYqEzo" target="_blank" rel="noreferrer">我用AeroSpace替代了yabai+skhd</a></li></ul><h2 id="apple-music" tabindex="-1">Apple Music <a class="header-anchor" href="#apple-music" aria-label="Permalink to “Apple Music”">​</a></h2><ul><li><a href="https://sspai.com/post/101340" target="_blank" rel="noreferrer">一日一技 | 如何用命令行将音乐转码到 iTunes Plus AAC</a></li></ul><h2 id="battery" tabindex="-1">battery <a class="header-anchor" href="#battery" aria-label="Permalink to “battery”">​</a></h2><ul><li><a href="https://www.sysgeek.cn/powerflow-for-mac/#google_vignette" target="_blank" rel="noreferrer">Powerflow：轻巧好用的 macOS 电源与充电状态监控神器</a></li><li><a href="https://github.com/vladkens/macmon" target="_blank" rel="noreferrer">vladkens/macmon</a></li><li><a href="https://apphousekitchen.com/aldente-overview" target="_blank" rel="noreferrer">altente</a></li></ul><h2 id="mac-上抓取应用的https的包" tabindex="-1">mac 上抓取应用的https的包 <a class="header-anchor" href="#mac-上抓取应用的https的包" aria-label="Permalink to “mac 上抓取应用的https的包”">​</a></h2><p>在Mac上抓取应用的HTTPS流量，你需要使用网络分析工具，如Wireshark、Charles Proxy或MITMproxy。由于HTTPS加密了数据传输，直接抓包无法查看具体内容，因此通常需要设置一个代理服务器来进行中间人攻击（Man-in-the-Middle, MITM）来解密和检查HTTPS流量。</p><p>以下是使用Charles Proxy作为例子来说明如何进行HTTPS流量的抓取：</p><ol><li><p><strong>安装Charles Proxy</strong>:</p><ul><li>下载并安装Charles Proxy应用程序到你的Mac电脑上。</li></ul></li><li><p><strong>配置Charles SSL代理</strong>:</p><ul><li>打开Charles，前往<code>Proxy</code> -&gt; <code>SSL Proxying Settings</code>。</li><li>在<code>SSL Proxying</code>标签中点击<code>Enable SSL Proxying</code>。</li><li>添加你想要监控的应用程序使用的域名端口对，例如对于大多数Web流量是443端口。</li></ul></li><li><p><strong>安装Charles的SSL证书</strong>:</p><ul><li>为了让Charles能够解密HTTPS流量，你需要信任它的SSL证书。</li><li>在Charles中前往<code>Help</code> -&gt; <code>SSL Proxying</code> -&gt; <code>Install Charles Root Certificate</code>。</li><li>按照提示完成证书安装，并确保系统信任此证书。</li></ul></li><li><p><strong>配置设备或应用以使用Charles代理</strong>:</p><ul><li>如果你想抓取的是Mac本地应用的流量，你需要配置该应用使用Charles作为HTTP/HTTPS代理。</li><li>对于某些应用程序，这可能需要更改系统的网络设置，或者在应用内部设置代理服务器地址为<code>localhost</code>或<code>127.0.0.1</code>，端口号通常是8888（默认的Charles监听端口）。</li><li>如果是移动设备上的应用，你需要设置设备的Wi-Fi连接使用手动HTTP代理指向运行Charles的Mac的局域网IP地址和端口。</li></ul></li><li><p><strong>开始抓包</strong>:</p><ul><li>现在你可以启动目标应用程序并开始与它交互，所有的HTTPS流量应该会通过Charles被截获，并且如果你正确设置了SSL代理，你应该能看到解密后的流量。</li></ul></li><li><p><strong>过滤和分析流量</strong>:</p><ul><li>使用Charles提供的过滤器和搜索功能来定位你感兴趣的特定请求和响应。</li></ul></li></ol><p>请注意，抓取和解密HTTPS流量可能涉及到隐私问题以及违反服务条款的风险。务必确保你有合法的权利去监视和分析这些流量。如果你是在测试自己的应用，确保遵循公司的政策和法律要求。如果你试图分析第三方应用的流量，请确保你有权这样做。</p><h3 id="charles" tabindex="-1">charles <a class="header-anchor" href="#charles" aria-label="Permalink to “charles”">​</a></h3><ul><li><a href="https://cloud.tencent.com/developer/article/1731184" target="_blank" rel="noreferrer">Mac使用Charles进行HTTPS抓包</a></li><li><a href="https://cloud.tencent.com/developer/article/2016392" target="_blank" rel="noreferrer">高颜值抓包工具Charles，实现Mac和IOS端抓取https请求</a></li><li><a href="https://charlesdocsy.com/2020/05/05/configure-charles-proxy-root-certificate-on-mac/" target="_blank" rel="noreferrer">Configure Charles Root certificate on Mac</a><ul><li>需要在keychains里信任证书</li></ul></li><li><a href="https://stackoverflow.com/questions/52862256/charles-proxy-for-mobile-apps-that-use-ssl-pinning" target="_blank" rel="noreferrer">Charles Proxy for Mobile apps that use SSL Pinning</a></li><li><a href="https://www.appknox.com/blog/bypass-ssl-pinning-in-ios-app" target="_blank" rel="noreferrer">8 Ways to Bypass SSL Pinning in iOS</a></li></ul><h2 id="tools" tabindex="-1">tools <a class="header-anchor" href="#tools" aria-label="Permalink to “tools”">​</a></h2><h3 id="neofetch" tabindex="-1">neofetch <a class="header-anchor" href="#neofetch" aria-label="Permalink to “neofetch”">​</a></h3><ul><li>mac 安装 <code>brew install neofetch</code></li><li>ubuntu 安装 <code>sudo apt install neofetch</code></li></ul><h2 id="mess" tabindex="-1">mess <a class="header-anchor" href="#mess" aria-label="Permalink to “mess”">​</a></h2><ul><li><a href="https://www.bilibili.com/video/BV1jWwhe1Ekw" target="_blank" rel="noreferrer">我的Mac效率设置和软件（2024）</a></li><li><a href="https://www.v1tx.com/post/best-mac-system-monitor/" target="_blank" rel="noreferrer">10款好用的Mac系统监控软件推荐</a></li><li><a href="https://www.bilibili.com/video/BV17PgNzHERm" target="_blank" rel="noreferrer">建模太阳磁场、运行本地大模型！为什么学生都爱用Macbook Air？</a></li><li><a href="https://github.com/Lakr233/MobileTransfer" target="_blank" rel="noreferrer">Lakr233/MobileTransfer</a><ul><li>MobileTransfer is an app operating on MobileBackup (idevicebackup2). It offers a way to backup and restore data on iOS devices.</li></ul></li><li><a href="https://github.com/Lakr233/BBackupp" target="_blank" rel="noreferrer">Lakr233/BBackupp</a><ul><li>Back up your iOS devices the way it&#39;s meant to be done.</li></ul></li></ul><h2 id="questions" tabindex="-1">questions <a class="header-anchor" href="#questions" aria-label="Permalink to “questions”">​</a></h2><ul><li>2024-11-15 指纹识别及录入问题 <ul><li><a href="https://discussionschinese.apple.com/thread/252333633?sortBy=rank" target="_blank" rel="noreferrer">M1 macbookPro 指纹不是识别及其慢就是识别不了，没有反应</a></li><li>电脑插电会有影响，不插电指纹功能是正常的</li></ul></li><li>2025-02-08 <ul><li><a href="https://apple.stackexchange.com/questions/346091/is-there-a-way-to-download-screen-time-data-from-iphone-or-other-apple-devices" target="_blank" rel="noreferrer">Is there a way to download Screen Time data from iPhone or other Apple devices?</a><ul><li><a href="https://timingapp.com" target="_blank" rel="noreferrer">Timing</a></li></ul></li></ul></li></ul>`,69)])])}const m=a(t,[["render",o]]);export{b as __pageData,m as default};
